import React, { useState } from 'react';
import './css/RegistrationPage.css'; // Подключаем CSS файл 

function RegistrationPage() {
  const [lastName, setLastName] = useState('');
  const [firstName, setFirstName] = useState('');
  const [middleName, setMiddleName] = useState('');
  const [phone, setPhone] = useState('');
  const [email, setEmail] = useState('');
  const [address, setAddress] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');

  const handleRegistration = (event) => {
    event.preventDefault();
    // Проверка Фамилии
    if (!/^[\u0410-\u042f\u0430-\u044f]+$/u.test(lastName)) {
      setError('Фамилия должна быть написана на русском одним словом');
      return;
    }

    // Проверка Имени
    if (!/^[\u0410-\u042f\u0430-\u044f]+$/u.test(firstName)) {
      setError('Имя должно быть написано на русском одним словом');
      return;
    }

    // Проверка Email
    if (!/^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(email)) {
      setError('Email должен быть в формате example@mail.com');
      return;
    }

    // Проверка Телефона
    if (!/^79\d{9}$/.test(phone)) {
      setError('Телефон должен начинаться с 79 и содержать 11 цифр');
      return;
    }

    // Проверка Пароля
    if (!/^\d{6}$/.test(password)) {
      setError('Пароль должен состоять из 6 цифр');
      return;
    }

    // Ваша логика регистрации здесь
  };

  return (
    <div className="container">
      <form className="form" onSubmit={handleRegistration}>
        <h2 className="title">РЕГИСТРАЦИЯ</h2>
        <div className="input-container">
          <label>Фамилия:</label>
          <input
            className="input"
            type="text"
            value={lastName}
            onChange={(e) => { setLastName(e.target.value); setError(''); }}
            placeholder="Введите фамилию"
          />
        </div>
        <div className="input-container">
          <label>Имя:</label>
          <input
            className="input"
            type="text"
            value={firstName}
            onChange={(e) => { setFirstName(e.target.value); setError(''); }}
            placeholder="Введите имя"
          />
        </div>
        <div className="input-container">
          <label>Отчество (при наличии):</label>
          <input
            className="input"
            type="text"
            value={middleName}
            onChange={(e) => { setMiddleName(e.target.value); setError(''); }}
            placeholder="Введите отчество"
          />
        </div>
        <div className="input-container">
          <label>Телефон:</label>
          <input
            className="input"
            type="tel"
            value={phone}
            pattern="[0-9]{3}-[0-9]{3}-[0-9]{4}"
            onChange={(e) => { setPhone(e.target.value); setError(''); }}
            placeholder="Введите номер телефона"
          />
        </div>
        <div className="input-container">
          <label>Email:</label>
          <input
            className="input"
            type="email"
            value={email}
            onChange={(e) => { setEmail(e.target.value); setError(''); }}
            placeholder="example@mail.com"
          />
        </div>
        <div className="input-container">
          <label>Адрес:</label>
          <input
            className="input"
            type="text"
            value={address}
            onChange={(e) => { setAddress(e.target.value); setError(''); }}
            placeholder="Введите адрес"
          />
        </div>
        <div className="input-container">
          <label>Пароль:</label>
          <input
            className="input"
            type="password"
            value={password}
            onChange={(e) => { setPassword(e.target.value); setError(''); }}
            placeholder="Введите пароль"
          />
        </div>
        {error && <p className="error">{error}</p>}
        <input className="button" type="submit" value="РЕГИСТРАЦИЯ" />
      </form>
    </div>
  );
}

export default RegistrationPage;
